import React from "react";
import {useDispatch, useSelector} from "react-redux";

 function Login () {
    const users = useSelector(state => state.users);
    const dispatch = useDispatch();

    return (
        <div className="Container">
            <ul>
            {users.map(({id, name})=>(
                <li key={id}>{name}</li>
            ))}
            </ul>
        </div>
    )

}

export default Login
